USE CATALOG paimon_hive;
CREATE DATABASE IF NOT EXISTS ods;
USE ods;


-- 字段映射说明:
-- record_time: 当前时间戳
-- hash: 对应JSON的hash字段
-- buyer_address: 对应JSON的from字段 
